Syndicate XBOX360-COMPLEX

Take on the role of Miles Kilo, Eurocorp's latest prototype agent, and embark on a brutal action adventure 
of corruption and revenge. Syndicate takes players into a dark, Machiavellian world run without government 
oversight with many syndicates vying for total dominance of their local market place. With no one to 
question their intentions or actions, three mega corporations, Eurocorp, Cayman Global, and Aspari, are at 
the forefront of this brutal war for control of the pivotal American market.

In the world of Syndicate, everything is digitally connected, including the people. Players aren't limited 
to the weapons in their hands. Through DART 6 bio-chip technology implanted in their head, players can slow 
down time and breach the digital world around them to take down their foes using a variety of upgradable 
hacking mechanics. Syndicate's blend of fast-paced, futuristic, action shooter settings and story combined 
with innovative chip breach gameplay instantly immerses players in a unique digital world.

Chip enhanced gameplay: Slow down time, see through walls, and breach your enemy and everything digital in 
the world with Dart vision, A neural DART6 chip implant that allows you to interface directly with the Dataverse.

4 player online co op: Assemble your Syndicate for global domination. A 4 player, online co op experience 
like no other, with chip enhanced gameplay and 9 missions re imagined from the original Syndicate.

Visceral FPS experience: Utilize an upgradable arsenal of futuristic weapons, armor and gear to annihilate 
your enemies and harvest their chip technology for personal advancement and sinister corporate greed.

Sci Fi fiction: Immerse yourself in the world of Syndicate 2069, with a world-class sci-fi story experience,
written by bestselling author Richard Morgan.

